import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './AlbumResults.css';

function AlbumResults({ results }) {
  const navigate = useNavigate();

  const handleAlbumClick = (albumId) => {
    navigate(`/album/${albumId}`);
  };

  if (results.length === 0) {
    return null;
  }

  return (
    <div>
      <h2>Album Results</h2>
      <table className="album-table">
        <thead>
          <tr>
            <th>Album</th>
            <th>Artist</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          {results.map((result) => (
            <tr key={result._id}>
              <td onClick={() => handleAlbumClick(result._id)} className="album-link">
                {result.albumTitle}
              </td>
              <td>{result.artist}</td>
              <td>{result.year}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AlbumResults;
